/* eslint-disable jsx-a11y/alt-text */
import React from "react";
import { Link } from "react-router-dom";
import Spacer from "../common/Spacer";

function EducationEyelinerDipliner() {
  const scrollToTop = () => {
    window.scrollTo({
      top: 0,
      behavior: "smooth",
    });
  };
  return (
    <section id="departments" className="departments">
      <Spacer />
      <div className="container">
        <div className="section-title">
          <h2>ÜRÜNLERİMİZ</h2>
        </div>

        <div className="row gy-4">
              <div className="col-lg-3">
                <ul className="nav nav-tabs flex-column">
                  <li className="nav-item">
                    <Link
                      className="nav-link active show"
                      to="/EducationMicroblading"
                      onClick={scrollToTop}
                    >
                      Vidalar
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link
                      className="nav-link"
                      to="/EducationEyelinerDipliner"
                      onClick={scrollToTop}
                    >
                      Pimler
                    </Link>
                  </li>
                  <li className="nav-item">
                    <Link
                      className="nav-link"
                      to="/EducationDudakRenklendirme"
                      onClick={scrollToTop}
                    >
                      Somunlar
                    </Link>
                  </li>

                </ul>
              </div>
              <div className="col-lg-9">
                <div className="tab-content">
                  <div className="tab-pane active show" id="tab-1">
                    <div className="row gy-4">
                      {data.map((product) => {
                        const { picture, title, desc, nav, id } = product;
                        return (
                          <Col md={4} key={id} className="text-center mb-5">
                            <PortfolioOne
                              picture={picture}
                              title={title}
                              desc={desc}
                              nav={nav}
                            />
                          </Col>
                        );
                      })}
                    </div>
                  </div>
                  <div className="tab-pane" id="tab-2">
                    <div className="row gy-4">
                      {data.map((product) => {
                        const { picture, title, desc, nav, id } = product;
                        return (
                          <Col md={4} key={id} className="text-center mb-5">
                            <PortfolioOne
                              picture={picture}
                              title={title}
                              desc={desc}
                              nav={nav}
                            />
                          </Col>
                        );
                      })}
                    </div>
                  </div>
                  <div className="tab-pane" id="tab-3">
                    <div className="row gy-4">
                      {data.map((product) => {
                        const { picture, title, desc, nav, id } = product;
                        return (
                          <Col md={4} key={id} className="text-center mb-5">
                            <PortfolioOne
                              picture={picture}
                              title={title}
                              desc={desc}
                              nav={nav}
                            />
                          </Col>
                        );
                      })}
                    </div>
                  </div>
                  <div className="tab-pane" id="tab-4">
                    <div className="row gy-4">
                      {data.map((product) => {
                        const { picture, title, desc, nav, id } = product;
                        return (
                          <Col md={4} key={id} className="text-center mb-5">
                            <PortfolioOne
                              picture={picture}
                              title={title}
                              desc={desc}
                              nav={nav}
                            />
                          </Col>
                        );
                      })}
                    </div>
                  </div>
                </div>
              </div>
            </div>
      </div>
    </section>
  );
}

export default EducationEyelinerDipliner;
